// helpers
var _page_home;

var pageHome = function()
{
  var page_id = 'home';
  var $document = $(document);
  var page = null;

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // make listed functions a public
  // ------------------------------------------------------------------------------------------------------------------------------------------------------------

  return {
    init : _init
  };

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init

  function _init(){
    $document.on('page_change', _check);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // check

  function _check(e, current_page, last_page, type)
  {
    if(current_page.find('.page_id').val() != page_id) return;

    page = current_page;
    
    switch(type)
    {
      case 'reinit':
        _reInit();
      break;
      case 'animation_in':
        _animationIn();
      break;
      case 'animation_out':
        _animationOut();
      break;
    }
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init on load

  function _reInit()
  {
    $('.carousel').carousel({interval: 6000});
    //$('#cbp-qtrotator').cbpQTRotator({speed: 700, easing: 'ease', interval: 6000});
    document.title = page.find('.page_title').val();
    //TweenMax.to(page.find('.container_page'), 1, { scaleX: 1, scaleY: 1, alpha: 1, delay: 1, ease: Expo.easeOut });
    TweenMax.from(page.find('.container'), 1, { y: -200, alpha: 0, ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation in

  function _animationIn()
  {
    TweenMax.from(page.find('.bg_page'), 1, { alpha: 0, ease: Linear.easeOut });
    //TweenMax.from(page.find('.container'), 1, { y: -200, alpha: 0, ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
    _deeplink.reInitAnimation(_deeplink.delayReInit);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation out

  function _animationOut()
  {
    //TweenMax.to(page.find('.bg_page'), 1, { alpha: 0, ease: Linear.easeIn });
    TweenMax.to(page.find('.container'), 1, { y: 200, alpha: 0, ease: Expo.easeOut });
    //TweenMax.to(page.find('.container_page'), 1, { scaleX: .8, scaleY: .8, alpha: .8 ,ease: Expo.easeOut});
  }

};

var _page_about;

var pageAbout = function()
{
  var page_id = 'about';
  var $document = $(document);
  var page = null;
  var last = null;

  var word_list = [
    {text: "Veille", weight: 13},
    {text: "Artistique", weight: 10},
    {text: "Technologique", weight: 10},
    {text: "Photographie", weight: 9},
    {text: "Dessin", weight: 8},
    {text: "Street Art", weight: 6},
    {text: "Gulp", weight: 5, link: {href: "http://gulpjs.com", target: "_blank"}},
    {text: "Less", weight: 5, link: {href: "http://lesscss.org", target: "_blank"}},
    {text: "Sass", weight: 5, link: {href: "http://sass-lang.com", target: "_blank"}},    
    {text: "Montagne", weight: 5},
    {text: "Ski", weight: 4},
    {text: "Snow Board", weight: 4},
    {text: "Pêche", weight: 3},
    {text: "Musique", weight: 3},
    {text: "Composition", weight: 3},
    {text: "Arrangement", weight: 3},
    {text: "Football", weight: 3},
    {text: "Capoeïra", weight: 3},
    {text: "Cirque", weight: 3},
  ];

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // make listed functions a public
  // ------------------------------------------------------------------------------------------------------------------------------------------------------------

  return {
    init : _init
  };

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init

  function _init(){
    $document.on('page_change', _check);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // check

  function _check(e, current_page, last_page, type)
  {
    if(current_page.find('.page_id').val() != page_id) return;

    page = current_page;
    last = last_page;
    
    switch(type)
    {
      case 'reinit':
        _reInit();
      break;
      case 'animation_in':
        _animationIn();
      break;
      case 'animation_out':
        _animationOut();
      break;
    }
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init on load

  function _reInit()
  {
    document.title = page.find('.page_title').val();
    //TweenMax.from(page.find('.img'), 1, { delay: 1, scaleX: .8, scaleY: .8, ease: Back.easeOut, repeat: -1, yoyo: true });

    page.find('.title').click(function(){
      page.find('.title').css('pointer-events', 'auto');
      $(this).css('pointer-events', 'none');
      TweenMax.to(page.find('.text'), 1, { className: '-=active', ease: Expo.easeOut });
      TweenMax.to($(this).next(), 1, { className: '+=active', ease: Expo.easeOut });
    });

    $(function() {
        page.find('.cloud').jQCloud(word_list);
    });
    
    if( last != '' ) {
      TweenMax.to(last.find('.container_page'), 2, { scaleX: .8, scaleY: .8, alpha: .8, ease: Expo.easeOut, onComplete: function(){
        TweenMax.to(page.find('.cover, .details'), 1, { className: '+=active',ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
      }});
    } else {
      TweenMax.to(page.find('.cover, .details'), 1, { className: '+=active',ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
    }
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation in

  function _animationIn()
  {
    TweenMax.to(page.find('.cover, .details'), 1, { className: '+=active',ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
    _deeplink.reInitAnimation(_deeplink.delayReInit);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation out

  function _animationOut()
  {
    TweenMax.set(last.find('.container_page'), { scaleX: .8, scaleY: .8, alpha: .8});
    TweenMax.to(page.find('.cover, .details'), 1, { className: '-=active',ease: Expo.easeOut, onComplete: function(){
      TweenMax.to(last.find('.container_page'), 2, { scaleX: 1, scaleY: 1, alpha: 1, ease: Expo.easeOut });
    }});
    //TweenMax.fromTo(last.find('.container_page'), 1, { scaleX: .8, scaleY: .8, alpha: .8, ease: Expo.easeOut }, { scaleX: 1, scaleY: 1, alpha: 1, ease: Expo.easeOut });
  }

};

var _page_works;

var pageWorks = function()
{
  var page_id = 'works';
  var $document = $(document);
  var page = null;

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // make listed functions a public
  // ------------------------------------------------------------------------------------------------------------------------------------------------------------

  return {
    init : _init
  };

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init

  function _init(){
    $document.on('page_change', _check);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // check

  function _check(e, current_page, last_page, type)
  {
    if(current_page.find('.page_id').val() != page_id) return;

    page = current_page;
    
    switch(type)
    {
      case 'reinit':
        _reInit();
      break;
      case 'animation_in':
        _animationIn();
      break;
      case 'animation_out':
        _animationOut();
      break;
    }
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // init on load

  function _reInit()
  {
    document.title = page.find('.page_title').val();

    TweenLite.set(".wrapper", {perspective:400});
    TweenLite.set(".back", {rotationX:180});
    TweenLite.set([".back", ".front"], {backfaceVisibility:"hidden"});

    (function($) {
        $.fn.clickToggle = function(func1, func2) {
            var funcs = [func1, func2];
            this.data('toggleclicked', 0);
            this.click(function() {
                var data = $(this).data();
                var tc = data.toggleclicked;
                $.proxy(funcs[tc], this)();
                data.toggleclicked = (tc + 1) % 2;
            });
            return this;
        };
    }(jQuery));

    page.find('.wrapper').clickToggle(function() {
      var wrapper = $(this);
      TweenMax.to(wrapper, .5, { scaleX: .9, scaleY: .9, ease: Expo.easeOut, onComplete: function(){
        TweenMax.to(wrapper.find('.front'), .5, { alpha: 0, ease: Expo.easeOut, delay: .5 });
        TweenLite.to(wrapper.find('.card'), 1, {rotationX:-180, transformOrigin:"left 270px", transformStyle:"preserve-3d", ease:Back.easeInOut, onComplete: function(){
          TweenMax.to(wrapper, .6, { scaleX: 1, scaleY: 1, ease: Expo.easeOut });
        }});
      }});
    }, function() {
      var wrapper = $(this);
      TweenMax.to(wrapper, .5, { scaleX: .9, scaleY: .9, ease: Expo.easeOut, onComplete: function(){
        TweenMax.to(wrapper.find('.front'), .5, { alpha: 1, ease: Expo.easeOut, delay: .5 });
        TweenLite.to(wrapper.find('.card'), 1, {rotationX:-360, transformOrigin:"left 270px", transformStyle:"preserve-3d", ease:Back.easeInOut, onComplete: function(){
          TweenMax.to(wrapper, .6, { scaleX: 1, scaleY: 1, ease: Expo.easeOut});
        }});
      }});
    });  

    TweenMax.from(page.find('.cbp-ig-grid li:nth-child(3n)'), 1, { x: 200, alpha: 0, ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
    TweenMax.from(page.find('.cbp-ig-grid li:nth-child(3n-2)'), 1, { x: -200, alpha: 0, ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
    TweenMax.from(page.find('.cbp-ig-grid li:nth-child(3n-1)'), 1, { y: 200, alpha: 0, ease: Expo.easeOut, delay: _deeplink.delayBeforeAnimIn });
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation in

  function _animationIn()
  {
    TweenMax.from(page.find('.bg_page'), 1, { alpha: 0, ease: Linear.easeOut });
    _deeplink.reInitAnimation(_deeplink.delayReInit);
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // animation out

  function _animationOut()
  {
    TweenMax.to(page.find('.cbp-ig-grid li:nth-child(3n)'), 1, { x: 200, alpha: 0, ease: Expo.easeOut });
    TweenMax.to(page.find('.cbp-ig-grid li:nth-child(3n-2)'), 1, { x: -200, alpha: 0, ease: Expo.easeOut });
    TweenMax.to(page.find('.cbp-ig-grid li:nth-child(3n-1)'), 1, { y: 200, alpha: 0, ease: Expo.easeOut });
  }

};
var _deeplink;

var Deeplink = function()
{

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // global vars

  var $main                = $( '#pt-main' ),
      $pages               = $main.children( 'div.pt-page' ),
      pagesCount           = $pages.length,
      current              = 0,
      zindex               = 1,
      $nextPage            = '',
      $currPage            = '',
      isAnimating          = false,
      delayBeforeAnimIn    = 1,
      delayReInit          = 2,
      $document            = $(document),
      firstload            = true,
      draggable            = null,
      chrome_ios           = (navigator.userAgent.match('CriOS')) ? false : true;

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // make listed functions a public

  return {
    init : _init,
    delayBeforeAnimIn : delayBeforeAnimIn,
    delayReInit: delayReInit,
    reInitAnimation : _reInitAnimation,
    getDraggable: _getDraggable,
  };

  function _getDraggable()
  {
    return draggable[0];
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // first init

  function _init(){
    $pages.each( function() {
      var $page = $( this );
      $page.data( 'originalClassList', $page.attr( 'class' ) );
    } );

    $pages.eq( current ).addClass( 'pt-page-current' );

    _updateBtnLang($pages.eq( current ).find('.page_lang_url_id').val());
    _hightlightMenu($pages.eq( current ).find('.page_menu_id').val());
    _customScrollbar($pages.eq( current ).find('.content_scroll'));

    _deeplink_event();

    $(window).resize(_onResize);

    $document.trigger('page_change', [ $pages.eq( current ), '', 'reinit' ] );
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // history deeplink

  function _deeplink_event()
  {  
    $( document ).on('click', ".ajax", function(e) {
      if( isAnimating ) return false;
      isAnimating = true;

      /*if(globalJS.agent_browser == 'IE' && globalJS.agent_browser_version <= 9)
      {
        // do nothing
      }
      else
      {*/
        history.pushState(null, null, this.href );
        _ajaxCall(this.href); 
        return false;
      //}
    });

    $(window).on('popstate', function(e) {
      if (firstload) return;
      var returnLocation = history.location || document.location;
      _ajaxCall(returnLocation.href);
    });
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // ajax call

  function _ajaxCall(url)
  {
    firstload = false;

    $.ajax({
      url: url,
      beforeSend: function(){
        // show loader
        TweenMax.killAll();
      },
      cache: chrome_ios,
      success: function(html) {
        _onBeforeReInit(html);
      }
    });

    // ga('send', 'pageview', { 'page' : window.location.pathname, 'title' : document.title });
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // tools like update lang url / highlight menu / create new scroll container

  function _updateBtnLang(url)
  {
    $('#navigation .lang a').attr('href', url);
  }

  function _hightlightMenu(menu)
  {
    TweenMax.to($('#navigation .btn_nav'), 1, {className:"-=active"});
    TweenMax.to($('#navigation .btn_nav.' + menu), 1, {className:"+=active"});
  }

  function _customScrollbar(page)
  {
    _verifScrollBar(page);

    // draggable = Draggable.create(page, 
    // {
    //   type:"scrollTop", 
    //   edgeResistance:0.8, 
    //   throwProps:true, 
    //   cursor: 'default'
    // });
  }

  function _verifScrollBar(page)
  {
    hasVerticalScrollbar =  page.find('.content').width() !=  page.width();
    if(hasVerticalScrollbar)
      _hideScrollBar(page)
    else
      _showScrollBar(page);
  }

  function _hideScrollBar(page)
  {
    page.css({'right' : page.find('.content').width() - page.width() + 'px' })
  }

  function _showScrollBar(page)
  {
    page.css({'right' : '0px' })
  }

  function _onResize()
  {
    _verifScrollBar($pages.eq( current ).find('.content_scroll'));
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // after ajax call and before animation in out

  function _onBeforeReInit(html) 
  {
    $('.pt-page').not('.pt-page-current').css({opacity: 0}).html(html);

    $currPage = $pages.eq( current );
    ( current < pagesCount - 1 ) ? ++current : current = 0;
    $nextPage = $pages.eq( current ).addClass( 'pt-page-current' );
    //alert($currPage.name);
    $nextPage.css({ zIndex: zindex++ });

    TweenMax.to($nextPage, .2, {opacity: 1});

    _customScrollbar($nextPage.find('.content_scroll'))
    _updateBtnLang($nextPage.find('.page_lang_url_id').val());
    _hightlightMenu($nextPage.find('.page_menu_id').val());

    $document.trigger('page_change', [ $currPage, $nextPage, 'animation_out' ] );
    $document.trigger('page_change', [ $nextPage, $currPage, 'animation_in' ] );
    $document.trigger('page_change', [ $nextPage, $currPage, 'reinit' ] );
  }

  // ------------------------------------------------------------------------------------------------------------------------------------------------------------
  // reinit

  function _reInitAnimation(delay)
  {
    TweenMax.delayedCall(delay, function(){
      isAnimating = false;

      $currPage.attr( 'class', $currPage.data( 'originalClassList' ) ).empty();
      $nextPage.attr( 'class', $nextPage.data( 'originalClassList' ) + ' pt-page-current' );
    });
  }

};

